BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "payments" ("time" datetime NULL, "total_collected" decimal NULL, "fees" decimal NULL, "net_total" decimal NULL, "customer_name" varchar(255) NULL, "card_brand" varchar(255) NULL, "pan_suffix" varchar(255) NULL, "fee_percentage_rate" decimal NULL, "field1" varchar(255) NULL, "id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sale_id" bigint NULL REFERENCES "sales" ("id") DEFERRABLE INITIALLY DEFERRED, "payment_id" varchar(255) NOT NULL, "deposit_date" datetime NULL);
COMMIT;
